script: |
  super -f text -I q4047.spq | sort > q4047.out

inputs:
  - name: q4047.spq
    data: |
      SELECT DISTINCT COUNT ( * ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN 66 AND + col2 * - - 19 + col1 * - + ( col1 );
  - name: tab0

outputs:
  - name: q4047.out
    data: |
      1
